    override val name: TextComponent = Component.text("[ 익스플로전 ]")
    override val itemType: Material = Material.BLAZE_ROD

    init {
        playerInteractionEvent {
            require(Requires.THIS_ITEM)
            require(Requires.RIGHT_CLICK)
            val block = Selector(100).selectBlock(playerLocation) ?: return@playerInteractionEvent
            player.performCommand(COMMAND1.replace("COURDINATE","${block.location.x} ${block.location.y+60} ${block.location.z}"))
            player.performCommand(COMMAND2.replace("COURDINATE","${block.location.x} ${block.location.y+50} ${block.location.z}"))
            player.performCommand(COMMAND3.replace("COURDINATE","${block.location.x} ${block.location.y+40} ${block.location.z}"))

            if(player != command_juho()) throw RequirementDenied("")

            val dir = playerLocation.direction.clone()
            //val t = dir.setY(0.0).clone().rotateAroundY((36*it).toDouble()).multiply(10)


            repeat(60){
                val t : Vector = dir.setY(0.0).clone().rotateAroundY((36*it).toDouble())

                block.location.world.apply {
                    if(it.mod(5) == 0){
                        createExplosion(block.location.clone().add(0.0,0.0,0.0).add(t.clone().multiply(10)),32f,true)
                        createExplosion(block.location.clone().add(0.0,-10.0,0.0).add(t.clone().multiply(10)),32f,true)
                        createExplosion(block.location.clone().add(0.0,-20.0,0.0).add(t.clone().multiply(10)),32f,true)
                    }
                    createExplosion(block.location.clone().add(0.0,-10.0,0.0).add(t.clone().multiply(30)),32f)
                    createExplosion(block.location.clone().add(0.0,-20.0,0.0).add(t.clone().multiply(30)),32f)

                    createExplosion(block.location.clone().add(0.0,-10.0,0.0).add(t.clone().multiply(50)),32f)
                    createExplosion(block.location.clone().add(0.0,-10.0,0.0).add(t.clone().multiply(70)),32f)
                    createExplosion(block.location.clone().add(0.0,10.0,0.0).add(t.clone().multiply(100)),32f)
                    createExplosion(block.location.clone().add(0.0,20.0,0.0).add(t.clone().multiply(120)),32f)
                    createExplosion(block.location.clone().add(0.0,30.0,0.0).add(t.clone().multiply(140)),32f)
                    createExplosion(block.location.clone().add(0.0,40.0,0.0).add(t.clone().multiply(160)),32f)
                }
            }
        }
    }
